////////////////////////////////////////////////////////////////////////////////
//
// Platinum Jubilee. mla, 2022
//
// I thought it would be fun to do something with run-length encoding (a
// suggestion by Fabrice on https://www.shadertoy.com/view/fdjyzy#), which
// works best on large blocks of color, something like a Warhol screen print
// eg. https://www.npg.org.uk/collections/search/portrait/mw08322/Queen-Elizabeth-II
// and by an extraordinary coincidence, today, February 6th, happens to be the
// 70th anniversary of Her Majesty's accession to the throne, so I've added some
// appropriate music as well. Not the Sex Pistols, alas. I couldn't find a
// decent MIDI.
//
////////////////////////////////////////////////////////////////////////////////
// Horizontally tile the window with an irregularly sized image from buffer.
// Buffer image is rotated by 90Â° for better fit with landscape aspect ratio.
////////////////////////////////////////////////////////////////////////////////

void mainImage(out vec4 fragColor, in vec2 fragCoord) {
  // x scroll a whole number of pixels.
  fragCoord.x += max(1.0,floor(float(iFrame)/1024.0*iResolution.x));
  vec2 uv = fragCoord.xy/iResolution.y;
  uv.y = 1.0-uv.y; // Flip y
  uv.y *= iResolution.y/iResolution.x;
  uv.x -= 0.5*(iResolution.x/iResolution.y-WIDTH/HEIGHT); // Centre x
  uv *= HEIGHT/iResolution.y; // Scale for y dimension
  float xwidth = WIDTH/iResolution.y;
  float xoffset = floor(uv.x/xwidth);
  uv.x -= xoffset*xwidth;
  vec3 col = texture(CHAN,uv.yx).rgb;
  int xindex = int(xoffset)+12;
  // Some simple Warholian color manipulations
  for (int i = 0; i < xindex%6; i++) {
    col = col.gbr;
    if (i==3) col.rg = col.gr;
  }
  if (xindex%2 != (xindex+2)/6%2) col.r = 1.0;
  fragColor = vec4(col,1);
}

#if 1
// The Queen
#define CHAN iChannel0
#define WIDTH 294.0
#define HEIGHT 462.0
#else
// William Kingdon Clifford
#define CHAN iChannel1
#define WIDTH 199.0
#define HEIGHT 299.0
#endif

const vec3 colors[] = vec3[](
vec3(0x00,0x70,0xa0),
vec3(0x00,0x70,0x90),
vec3(0x90,0x50,0x70),
vec3(0xf0,0xd0,0x50),
vec3(0x60,0x70,0xb0),
vec3(0x00,0x70,0xb0),
vec3(0x60,0xb0,0xb0),
vec3(0xc0,0xb0,0xb0),
vec3(0xf0,0xa0,0xd0),
vec3(0x00,0x80,0xb0),
vec3(0x10,0x90,0xa0),
vec3(0x10,0x90,0xc0),
vec3(0x00,0x80,0xc0),
vec3(0x00,0x90,0xb0),
vec3(0xe0,0xe0,0xe0),
vec3(0xf0,0xf0,0xf0));

int coloroffset = 0;
vec3 getcolor(int i) {
  if (i < 0) return vec3(0);
  i += coloroffset;
  i %= colors.length();
  return colors[i]/255.0;
}
// Show greyscale colors
vec3 getcolor0(int i) {
  return vec3( clamp(1.0-float(i)/9.0,0.0,1.0) );
}
